export const increment = (num) => {
    return {
        type: 'INCREMENT',
        payload: num
    }
}

export const decrement = (num) => {
    return {
        type: 'DECREMENT',
        payload: num
    }
}

export const checkLog = (sign) => {
    return {
        type: 'SIGN_IN',
        payload: sign
    }
}
